import React from "react";

class GoogleOauth extends React.Component {
  state = {
    isSignin: null,
  };
  componentDidMount() {
    window.gapi.load("client:auth2", () => {
      window.gapi.client.init({
        clientId:
          "119396726822-hku7q66tdljc79313nk08728alotf7vs.apps.googleusercontent.com",
        scope: "email",
      });
    });
  }
  render() {
    return <h1> login</h1>;
  }
}
export default GoogleOauth;
